    def prevPressed(self):
        if self.cycle > 0:
            self.cycle -= 1
            self.updateViews()

    def nextPressed(self):
        if self.cycle < len(self.result) - 1:
            self.cycle += 1
            self.updateViews()

    def resizeRow(self,view):
        for row in range(view.model().rowCount()):
            view.setRowHeight(row, 30)

